import { useRoutes } from 'react-router-dom';

// project imports
import CaseManagerRoutes from './role-based-routes/CaseManagerRoutes';
import ReviewBoardRoutes from './role-based-routes/ReviewBoardRoutes';
import LoginRoutes from './LoginRoutes';

// ===========================|| ROUTING RENDER ||=========================== //

const PagesLanding = Loadable(lazy(() => import('views/pages/landing')));

export default function ThemeRoutes() {
    return useRoutes([{ path: '/', element: <PagesLanding /> }, AuthenticationRoutes, LoginRoutes, CaseManagerRoutes, ReviewBoardRoutes]);
}
